import './App.css';
import './Navbar.css'
import Navbar from './components/Navbar';

function App() {
  return (
    <>
    <Navbar></Navbar>

    <div >
        <a className="select_host" href="/host">
          Einen Raum erstellen
        </a>
        <a className="select_join" href="/join">
          Einen Raum beitreten
        </a>
      </div>
    
    
    </>
  );
}

export default App;
